$( document ).ready(function() {
(function (jsPDFAPI) {

//Font THSaraban
var font = '';


var callAddFont = function () {
this.addFileToVFS('THSarabun-normal.ttf', font);
this.addFont('THSarabun-normal.ttf', 'THSarabun', 'normal');
};
jsPDFAPI.events.push(['addFonts', callAddFont])
 })(jsPDF.API);
 //Font


var workReport = 'data:image/jpeg;base64,';

// Form
$('.jpdf').click(function() {
    console.log("Clicked");
    var doc = new jsPDF();

    //console.log(signed);

    doc.addImage(workReport, 'JPEG',0,0,210,297);
    doc.setTextColor(0, 0, 0)
    doc.setFont('THSarabun');
    doc.setFontSize(9);

    //HTML PDF WINDOW
    var string = doc.output('datauristring');
    var embed = "<embed width='100%' height='100%' src='" + string + "'/>"
    var x = window.open();
    x.document.open();
    x.document.write('<title>RFA : {{$rfa->rfa_code ?? ''}}</title>');
    x.document.write(embed);
    x.document.close();
});
 </script>
